  SEMICOLON.documentOnReady = {
    init: function init() {
      SEMICOLON.initialize.init();
      SEMICOLON.header.init();

      if ($slider.length > 0 || $sliderElement.length > 0) {
        SEMICOLON.slider.init();
      }

      if ($portfolio.length > 0) {
        SEMICOLON.portfolio.init();
      }

      SEMICOLON.widget.init();
      SEMICOLON.documentOnReady.windowscroll();
      SEMICOLON.customization.onReady();

      if ($body.hasClass('adaptive-color-scheme')) {
        if (window.matchMedia && window.matchMedia('(prefers-color-scheme: dark)').matches) {
          $body.toggleClass('dark', true);
        }

        if (window.matchMedia) {
          window.matchMedia('(prefers-color-scheme: dark)').addEventListener('change', function (e) {
            e.matches ? $body.toggleClass('dark', true) : $body.toggleClass('dark', false);
          });
        }
      }

      $body.off('click').on('click', 'a[href*="#"]', function () {
        $window.on('beforeunload', function () {
          $window.scrollTop(0);
        });
      });
      var linkElement = location.hash;

      if ($(linkElement).length > 0 && $('.one-page-menu').find('[data-href="' + linkElement + '"]').length > 0) {
        $window.scrollTop(0);
      }
    },
    windowscroll: function windowscroll() {
      if ($header.length > 0) {
        headerOffset = $header.offset().top;
        $headerWrap.addClass('position-absolute');
        headerWrapOffset = $headerWrap.offset().top;
        $headerWrap.removeClass('position-absolute');
      }

      var headerDefinedOffset = $header.attr('data-sticky-offset');

      if (typeof headerDefinedOffset !== 'undefined') {
        if (headerDefinedOffset == 'full') {
          headerWrapOffset = $window.height();
          var headerOffsetNegative = $header.attr('data-sticky-offset-negative');

          if (typeof headerOffsetNegative !== 'undefined') {
            headerWrapOffset = headerWrapOffset - headerOffsetNegative - 1;
          }
        } else {
          headerWrapOffset = Number(headerDefinedOffset);
        }
      } else {
        if (headerWrapOffset === 'undefined') {
          headerWrapOffset = headerOffset;
        }
      }

      var pageMenuWrap = $pagemenu.find('#page-menu-wrap'),
          offset = $headerWrap.outerHeight(),
          head = document.head || document.getElementsByTagName('head')[0],
          style = document.createElement('style'),
          css;

      if ($pagemenu.length > 0) {
        $pageMenuClone.css({
          'height': $pagemenu.find('#page-menu-wrap').outerHeight()
        });
        setTimeout(function () {
          if ($header.length > 0 && !$header.hasClass('no-sticky')) {
            if ($body.hasClass('device-xl') || $body.hasClass('device-lg') || mobileSticky == 'true') {
              pageMenuOffset = $pagemenu.offset().top - $headerWrap.outerHeight();
              head.appendChild(style);
              css = '#page-menu.sticky-page-menu:not(.dots-menu) #page-menu-wrap { top: ' + offset + 'px; }';
              style.type = 'text/css';
              style.appendChild(document.createTextNode(css));
            } else {
              pageMenuOffset = $pagemenu.offset().top;
            }
          } else {
            pageMenuOffset = $pagemenu.offset().top;
          }
        }, 1000);
      }

      SEMICOLON.header.stickyMenu(headerWrapOffset);
      SEMICOLON.header.stickyPageMenu(pageMenuOffset);
      window.addEventListener('scroll', function () {
        SEMICOLON.initialize.goToTopScroll();
        $('body.open-header.close-header-on-scroll').removeClass("side-header-open");
        SEMICOLON.header.stickyMenu(headerWrapOffset);
        SEMICOLON.header.stickyPageMenu(pageMenuOffset);
        SEMICOLON.header.logo();
      });
      window.addEventListener('DOMContentLoaded', onScrollSliderParallax, false);
      $window.scrollEnd(function () {
        var headerHeight = $headerWrap.outerHeight();

        if ($headerWrapClone.length > 0 && headerHeight > $headerWrapClone.outerHeight()) {
          $headerWrapClone.css({
            'height': headerHeight
          });

          if ($body.hasClass('device-xl') || $body.hasClass('device-lg')) {
            SEMICOLON.header.includeOffset();
          }
        }

        if ($pagemenu.length > 0 && $header.length > 0 && !$header.hasClass('no-sticky')) {
          if ($body.hasClass('device-xl') || $body.hasClass('device-lg')) {
            $pagemenu.filter('.sticky-page-menu:not(.dots-menu,.no-sticky)').find($pageMenuWrap).css({
              'top': headerHeight + 'px'
            });
          }
        }
      }, 500);

      window.onfocus = function () {
        var headerHeight = $headerWrap.outerHeight();

        if ($headerWrapClone.length > 0 && headerHeight > $headerWrapClone.outerHeight()) {
          $headerWrapClone.css({
            'height': headerHeight
          });
        }
      };
    }
  };
